  render() {
    const items = []
    for(let i; i<8;i++){
      items.push(<li>{i}</li>);
    }
    return(
      <React.StrictMode>
        <LISTS>
            {items}
          </LISTS>
        </React.StrictMode>
    );
  }
}



const LISTS = styled.ul`
  display: flex;
  flex-wrap: wrap;
  justify-content: space-between;
  text-align: left;
`;

export default Products;
